  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:20.069857\",\n\t\"name\": \"tamarac-national-wildlife-refuge-narrative-report-may-june-july-august-1956\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tamarac NWR outlines
  Refuge accomplishments from May through August of 1956. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, raptors, and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and collections and receipts.
  Resource management is outlined; topics include haying and timber removal. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, Refuge visitors, Refuge
  participation, and fishing. N-R forms, photographs, and a student assistant's report
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
